//get longtitude/lat address,return station object that is closest to 
getNearestShuttleStation = function (lat, lon) {
	var distance = 0;
	var minDistance = -1;
	var result = {};

	var stations = telOFunStations.features;

	for (station in stations)
	{
		if (stations.hasOwnProperty(station)) {
    		//console.log("station's x,y" + " -> " + stations[station].geometry.x + "," + stations[station].geometry.y);
    		var stationLatLong = getLatLongFromXY(stations[station].geometry.x,stations[station].geometry.y);
    		//console.log(lat,lon,stationLatLong[0],stationLatLong[1]);
    		distance = calcDistance(lat,lon,stationLatLong[0],stationLatLong[1]);
    		if ((distance<minDistance)||(minDistance<0)){			
    			minDistance = distance;
    			result = stations[station];
    			//console.log("new min distance: "+distance);
    		}
    	}
    	else {
    		console.log("ERROR: station not found!");
    	}
	}
	//console.log("RETURNED station:"+unescape(result.attributes.Shem_tachana));
	//var latLng = getLatLongFromXY(result.geometry.x, result.geometry.y)
	//result.lat = latLng[1];
	//result.lng = latLng[0];

	return result;
}



